import React, { Component} from 'react';
import { Link,withRouter,Route, Switch, NavLink } from 'react-router-dom';
import {MenuItems} from './MenuItems'
import './Navbar.css'
import Home from './Home';
import Result from '../../Result';

class Navbar extends Component{
    
    
    
    
    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">Pnömani Teşhisi</h1>
                <div className="menu-icon">

                </div>
                <ul className="nav-menu">
                
                        
                            <li><Switch>
                               <NavLink to="/Home" className="nav-links">Home</NavLink></Switch>
                            </li>
                        
                    

                </ul>
                <Switch><Route exact path="/Home" component={Home}/>
                <Route path="/Result" component={Result}/>
                </Switch>
                                

            </nav>
      


        ) }
    
}

export default Navbar
